Imagine Microelectronics originates from the BW2030 initiative, a business platform reflecting on opportunities to foster innovation within the Walloon Brabant, and more globally the Walloon region. Imagine Microelectronics has been created to (1) accelerate the development of innovative and eco-responsible electronic system solutions, including original devices created by micro-nano-fabrication (sensors, etc.), (2) strengthen the strategic industries in Wallonia looking for local and high-quality microelectronics solutions, and finally (3) contribute to maintain and enrich local manufacturing capabilities. Imagine Microelectronics combines business and technical expertise and acts as a catalyst of microelectronic players (universities, excellence centres, market clusters, local investors, and large corporations). Its focus is to address business and technical needs related to TRL 3-7 with the following value proposition:
- Universities (e.g. UCLouvain, ULi√®ge, and UMons in Wallonia, etc.): acceleration of the maturation of laboratory technologies in TRL 3-4;
- Start-up/ scale-up: access to new capabilities at lower cost in a nearby environment;
- Large corporations: access to talent and expertise in the strategic areas of innovation;
- Local investors: access to a high-quality deal flow and opportunities for investment.
